  input: TEXT,SA11A1,SA11A1.17299,"We had  a great deal of diffiiculty with the conduit
    transactions.The basic problem was when we tryed to follow the 12 steps for entering
    a conduit tranaction into the FEC file as listed in 'Report by the Recipient Committee'
    from the help menu, step 7 did not work.  Step 1 indicated that 11a, b, or c could
    be chosen and we used 11c since the conduit was a PAC.  When we got to step 7
    and clicked OK we were never able to creat  an 11a transaction in the receipts
    window unless we entered the PAC under 11a, which we did.  This is the way we
    presented the entries in the report and it appears to be correct, except for the
    conduit agreggate.  It was our understanding the agreggate amount should not increase
    with conduit amounts, but when following the instructions, it does."
